import SerchIcon from "../Components/Icons/SerchIcon.vue";
export default {
  props: {
    setRoute: Function
  },
  data() {
    return {
      serchLog: ""
    };
  },
  components: {
    SerchIcon
  },
  computed: {
    logList() {
      return this.$store.getters[`adminPanel/getLogList`].slice().reverse();
    },
    filteredLogList() {
      return this.logList.filter(log => log.KillerUUID.toString().toLowerCase().includes(this.serchLog.toLowerCase()) || log.PlayerUUID.toString().toLowerCase().includes(this.serchLog.toLowerCase()));
    }
  }
};
